const TODOS = {
  LOGIN: `/api/login`,
  SIGN_UP: `/api/signup`, 
  ADD_TODO: `/secureApi/todo`,
  GET_TODOS: `/secureApi/todo`,
  UPDATE_TODO: `/secureApi/todo/:todoId`,
  DELETE_TODO: `/secureApi/todo/:todoId`,
  GET_TODO_DETAILS: `/secureApi/todo/:todoId`,
}
export { TODOS };
